import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import userIcon from './components/images/user.svg';

function Profile() {
  const [userProfile, setUserProfile] = useState({});
  const params = useParams(); // Get params from the URL
//   const { id } = params; // Extract condition from params
//   const { age } = params; // Extract condition from params
//   const { location } = params; // Extract condition from params
//   const { gender } = params; // Extract condition from params
//   const { education } = params; // Extract condition from params
//   const { condition } = params; // Extract condition from params

  useEffect(() => {
    // Fetch the user's profile data from your backend
    // You can use an API call to retrieve the data associated with the authenticated user
    // Update the userProfile state with the retrieved data
  }, [params]);

  return (
    <div>
      <h1>User Profile</h1>
      <div>
        {/* Display user icon/avatar */}
        <img src={userProfile.iconUrl} alt="User Icon" />
      </div>
      <div>
        {/* Display user profile information */}
        <p>Name: {userProfile.name}</p>
        <p>Email: {userProfile.email}</p>
        {/* Display additional profile details from URL */}
        <p>ID: {params.id}</p>
        <p>Age: {params.age}</p>
        <p>Location: {params.location}</p>
        <p>Gender: {params.gender}</p>
        <p>Education: {params.education}</p>
        <p>Condition: {params.condition}</p>
      </div>
    </div>
  );
}

export default Profile;
